import Link from "next/link";

const Page = () => (
  <section>
    <div className="carousel">
      <div className="slide" id="slide1">
      <div className="row">
                                <div className="col-12 col-sm-6 sm-mb-30">
                                    <div className="card border-0 review-card style1 position-relative">
                                        <div className="card-body px-50 py-50">
                                            <p className="card-text mb-20">The point of using Lorem Ipsum is thamore-or-less normal distribution of letters, as opposed to ntent here, content use to color.</p>
                                            <div className="media">
                                                <h5 className="mb-0">Rakib mia</h5>
                                                <h6 className="mb-0 ml-10 align-self-center">/ Developer</h6>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                
                                <div className="col-12 col-sm-6">
                                <div className="card border-0 review-card style1 position-relative">
                                    <div className="card-body px-50 py-50">
                                        <p className="card-text mb-20">The point of using Lorem Ipsum is thamore-or-less normal distribution of letters, as opposed to ntent here, content use to color.</p>
                                        <div className="media">
                                            <h5 className="mb-0">Rakib mia</h5>
                                            <h6 className="mb-0 ml-10 align-self-center">/ Developer</h6>
                                        </div>
                                    </div>
                                </div>
                                </div>
                                
                            </div>
      </div>
      <div className="slide" id="slide2"></div>
    </div>
    <style jsx>{`
      $blockWidth: 150px;
      $blockHeight: 75px;

      @mixin animated($name) {
        -webkit-animation-name: $name;
        animation-name: $name;
      }

      @mixin keyFramed($vals, $valsTop) {
        0% {
          left: nth($vals, 1);
          top: nth($valsTop, 1);
        }
        50.01% {
          left: nth($vals, 4);
          top: nth($valsTop, 4);
        }
        100% {
          left: nth($vals, 1);
          top: nth($valsTop, 1);
        }
      }

      @mixin myKeyFrame($number, $pos, $posTop) {
        @keyframes slide#{$number} {
          @include keyFramed($pos, $posTop);
        }

        @-webkit-keyframes slide#{$number} {
          @include keyFramed($pos, $posTop);
        }
      }

      $negativeBlockWidth: -1 * $blockWidth;

      $posFirst: 0px, $negativeBlockWidth, $negativeBlockWidth, 0px, $blockWidth,
        $blockWidth;
      $posSecond: $blockWidth, 0px, $negativeBlockWidth, $negativeBlockWidth,
        0px, $blockWidth;


      $negativeBlockHeight: -1 * $blockHeight;

      $posFirstTop: 0px, 0px, $negativeBlockHeight, $negativeBlockHeight,
        $negativeBlockHeight, 0px;
      $posSecondTop: 0px, 0px, 0px, $negativeBlockHeight, $negativeBlockHeight,
        $negativeBlockHeight;

      .carousel {
        position: relative;
        margin: 100px auto;
        width: $blockWidth;
        height: $blockHeight;
        overflow: hidden;
      }

      .slide {
        width: $blockWidth;
        height: $blockHeight;
        position: absolute;
        top: 0px;
        -webkit-animation-iteration-count: infinite;
        animation-iteration-count: infinite;
        -webkit-animation-duration: 15s;
        animation-duration: 15s;
        -webkit-animation-delay: 2s;
        animation-delay: 5s;
        -webkit-animation-timing-function: ease;
        animation-timing-function: ease;
        -webkit-animation-direction: normal;
        animation-direction: normal;
      }

      #slide1 {
        @include animated(slide1);
        left: 0px;
        top: 0px;
      }
      #slide2 {
        @include animated(slide2);
        left: $blockWidth;
        top: 0px;
      }

      @include myKeyFrame(1, $posFirst, $posFirstTop);
      @include myKeyFrame(2, $posSecond, $posSecondTop);
    `}</style>
  </section>
);

export default Page;
